import React from 'react';

function Interests(){
    return (
        <section className="resume-section" id="interests">
            <div class="resume-section-content">
                <h2 class="mb-5">Interests</h2>
                <p>Apart from being a software engineer, I enjoy most of my time being outdoors. During the warmer months here in Sydney, I enjoy swimming, trail walks, and hiking.</p>
                <p class="mb-0">When forced indoors, I follow a number of sci-fi and fantasy genre movies and television shows.</p>
            </div>
        </section>
    )
}

export default Interests;
